export const sortData = (data) =>{
    const sortedData = [...data];

    sortedData.sort((a,b)=>{
        console.log(a.cases);
        if(a.cases>b.cases){
            return true;
        }

        else{
            return false;
        }

    })

    return sortedData;

};
